; (function () {
  const nodes = document.getElementById("main")
  if (!nodes) return
  Array.prototype.forEach.call(nodes.children, function (el, idx) {
    if (!el.id && el.className != 'container-fluid px-0') {
      el.style.display = 'none'
    }
  })
})()